import React from "react";

function ArchiveList(props) {
  const tasks = props.archiveTasks;

  function createTask(task, index) {
    return (
      <div key={index} className="h-95 p-5 bg-body-tertiary border rounded-3 mt-2">
        <h3 className="archive-list-title">Archive Lists</h3>
        <ul>
          <li>{task}</li>
        </ul>
      </div>
    );
  }

  return <div>{tasks.map((task, index) => createTask(task, index))}</div>;
}

export default ArchiveList;
